import './App.css';
import { BrowserRouter, Router, Routes, Route} from 'react-router-dom';
import home from './components/Pages/home';



function App() {

  return (
    <div className="App">
        <BrowserRouter>
            <Routes>
                <Route path="/" element={<home/>}/>
            </Routes>
        </BrowserRouter>
    </div>
  );

}

export default App;
